import React from "react";
import { Link } from 'react-router-dom';

class Login extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div>
            <h1>Login</h1>
            <Link to="/core" />
            </div>
        )
    }
}

export default Login;
